import { StyleSheet, Text, View, Button, TextInput } from "react-native";

const App = () => {
  return (
    <View style={styles.container}>
      <View style={styles.inputContainer}>
        <TextInput placeholder="Your Goal Here!" style={styles.textInput} />
        <Button title="Add Goal!" />
      </View>
      <View>
        <Text>Your Goals...</Text>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    padding: 50,
  },

  inputContainer: {
    flexDirection: "row",
    justifyContent: "space-between",
  },

  textInput: {
    borderWidth: 1,
    borderColor: "#cccccc",
    width: "70%",
    marginRight: 8,
    padding: 8,
  },
});

export default App;
